  return (
    <div className="header-container">
      <div className="logo-title">
        <img className="header-logo" src={Logo} alt="Logo" /> {/* Logo */}
        <h1 className="clinic-title">
  <span className="clinic-main">Clínica Veterinária</span> <br />
